    <em>{sp1} substitutes {sp2}.</em>
  ',
'{sp1} geht auf seinen Gegenspieler zu und gewinnt den Zweikampf!'=>'¡{sp1} corre hacia su oponente y gana el placaje!',
'{sp1} in einem Zweikampf.... gewonnen!'=>'{sp1} en un placaje... ¡y lo gana!',
'{sp1} läuft mit dem Ball am Fuß auf seinen Gegenspieler zu... und gewinnt den Zweikampf.'=>'{sp1} tiene el balón y ve a su oponente frente a él... pero puede ganar la entrada.',
