'{sp1} geht auf {sp2} zu... und verliert den Zweikampf.'=>'{sp1} corre hacia {sp2}... y pierde el balón.',
'{sp1} in einem Zweikampf.... und verliert ihn.'=>'{sp1} en un placaje... ¡y lo pierde!',
'{sp1} geht mit dem Ball am Fuß auf seinen Gegenspieler zu... und verliert ihn.'=>'{sp1} tiene el balón y ve a su oponente frente a él... y pierde el placaje.',
