'Pass von {sp1}... ins Seitenaus.'=>'{sp1} pasa el balón... y el balón sale.',
'{sp1} hat freie Bahn und schießt... weit über das Tor.'=>'{sp1} tiene la oportunidad de disparar... y ni siquiera puede apuntar a la portería.',
'{sp1} schießt..... daneben.'=>'{sp1} dispara... pero falla.',
'{sp1} schießt auf das Tor... aber genau auf den Torwart.'=>'{sp1} dispara hacia la portería... ¡pero a los brazos del portero!',
'Kopfball {sp1}... daneben.'=>'Cabezazo de {sp1}... pero falló.',
'{sp1} haut mit aller Kraft auf den Ball... Abschlag.'=>'{sp1} lo intenta con un fuerte disparo... pero falla.',
'{sp1} schießt..... in die Wolken.'=>'{sp1} dispara... hacia el cielo.',
'{sp1} schießt..... Glanzparade des Torwarts!'=>'{sp1} dispara... pero el portero de alguna manera puede atraparlo.',
