'{sp1} sieht die gelbe Karte.'=>'{sp1} recibe la tarjeta amarilla.',
'{sp1} haut seinen Gegenspieler um und bekommt dafür die gelbe Karte.'=>'{sp1} golpea a su oponente y obtiene la tarjeta amarilla por eso.',
'{sp1} springt von hinten in die Beine seinen Gegenspielers und sieht sofort die Rote Karte.'=>'
    <i>{sp1} jumps from the back on his opponent\'s legs and geths the red card for that.</i>
  ',
