    <i>{sp1} gets the redcard because he started a punch-up.</i>
  ',
'{sp1} sieht die Gelb-Rote Karte und muss vom Platz.'=>'
    <i>{sp1} sees the yellow-red card and must leave the pitch.</i>
  ',
'{sp1} haut seinen Gegenspieler um und bekommt dafür die Gelb-Rote Karte.'=>'
    <i>{sp1} hits his opponent and gets the yellow-red card for that.</i>
  ',
'{sp1} sieht nach einem bösen Foul die Rote Karte und muss vom Platz.'=>'
    <i>{sp1} gets the red card after a very brutal foul.</i>
  ',
'{sp1} ist verletzt und muss vom Spielfeld getragen werden.'=>'
